import React, {Component} from 'react'
import Layout from "../_layouts/default/Layout";

class CompositionsPage extends Component {
    render() {
        return (
            <Layout>
                <div><h1>Compositions</h1></div>
                <div>filter</div>
                <div>
                    <ul>
                        <li>Comp 1</li>
                        <li>Comp 2</li>
                        <li>Comp 3</li>
                        <li>Comp 4</li>
                        <li>Comp 5</li>
                    </ul>
                </div>
                <div>Pager</div>
            </Layout>
        )
    }
}

export default CompositionsPage
